package com.daoben.rfid.model;

import java.sql.Timestamp;
public class AssetCheck {
	private String tag_Id;
	private int check_State;
	private String check_Detil;
	private String user_Name;
	private Timestamp register_Time;
	public AssetCheck() {
		super();
		// TODO Auto-generated constructor stub
	}
	public AssetCheck(String tag_Id, int check_State, String check_Detil, String user_Name, Timestamp register_Time) {
		super();
		this.tag_Id = tag_Id;
		this.check_State = check_State;
		this.check_Detil = check_Detil;
		this.user_Name = user_Name;
		this.register_Time = register_Time;
	}
	public String getTag_Id() {
		return tag_Id;
	}
	public void setTag_Id(String tag_Id) {
		this.tag_Id = tag_Id;
	}
	public int getCheck_State() {
		return check_State;
	}
	public void setCheck_State(int check_State) {
		this.check_State = check_State;
	}
	public String getCheck_Detil() {
		return check_Detil;
	}
	public void setCheck_Detil(String check_Detil) {
		this.check_Detil = check_Detil;
	}
	public String getUser_Name() {
		return user_Name;
	}
	public void setUser_Name(String user_Name) {
		this.user_Name = user_Name;
	}
	public Timestamp getRegister_Time() {
		return register_Time;
	}
	public void setRegister_Time(Timestamp register_Time) {
		this.register_Time = register_Time;
	}
	@Override
	public String toString() {
		return "AssetCheck [tag_Id=" + tag_Id + ", check_State=" + check_State + ", check_Detil=" + check_Detil
				+ ", user_Name=" + user_Name + ", register_Time=" + register_Time + "]";
	}
	
	
	
}
